    super(props);
    this.state = {
      name: "",
      ParkImages: [],
      parkCode: "",
      park: "Hello"
    };
  }
  componentDidMount() {
    {
      let url =
        "https://developer.nps.gov/api/v1/parks?api_key=y010UOulh2F9R7ahrlYpcyXUEJltY7vRei1uVxpe";
      fetch(url)
        .then(res => res.json())
        .then(res =>
          this.setState({
            park: res.data[0],
            parkCode: res.data[0].parkCode,
